import React, { useEffect, useState } from "react";

export default function data({state}){
    return(
        <div id="DataInfo row">
            <button className="btn btn-light col-lg-3" id="button_home"><strong>Search New State</strong></button>
            <h1 id="state_header">{state} Stats</h1>
        </div>
    );
}
